import React from 'react';


function Nav(props) {
    // deconstructor...this always trips me up
    const {
        navOptions = [],
        currentOption,
        setCurrentOption 
    } = props;

    return(
        <header class="navbar fixed-top navbar-expand-lg navbar-dark bg-dark">
            <nav >

                    <div class="collapse navbar-collapse" id="navbarNav">
                        <ul class="navbar-nav">
                            {navOptions.map((navOption) => (
                                <div class="col-6">
                                    <li
                                        className={ `${currentOption === navOption && 'nav-item navSelected'}`}
                                    >
                                        <span
                                            onClick={() => {
                                                setCurrentOption(navOption);
                                            }}
                                        >
                                            {navOption.text}
                                        </span>
                                    </li>
                                </div>
                            ))}
                        </ul>
                    </div>

            </nav>
        </header>
    )
}

export default Nav;
